import React from 'react';
import { Container, Row, Col,Button } from 'reactstrap';
import dynamic from 'next/dynamic'
import './styles/Dashboard.css';

const DynamicComponent = dynamic(() => import('../components/Card'))


const Index = () => (
    // border bottom
    <Container fluid>
    <Row>
      <Col sm className="title">ORANGEPICK</Col>
      <Col sm className="discovery"><p >Discovery</p></Col>
      <Col sm>
        <Button variant="primary" size="lg" active>
            Login/Sign Up
        </Button>
        </Col>
    </Row>
    <Row style= {{justifyContent: 'center', alignItems: 'center', fontFamily:'Span' }} >
        <p> Launched on OrangePick today </p>
    </Row>
    <DynamicComponent></DynamicComponent>
    </Container>
    //before container row then the card
  )
export default Index
